import React, { useState } from "react";

function Cards() {

    function Alert_Target(event){
        alert(event.target.className)
    }

  return (
    <div className="images_box" onClick={Alert_Target}>
        <div className="image1">
            <img src="/images/Vlad.jpg" className="image_one"/>
            <img src="/images/Nada.jpg" className="image_two"/>
        </div>
        <div className="image2">
            <img src="/images/Vlad.jpg"/>
        </div>
        <div className="image3">
            <img src="/images/Vlad.jpg"/>         
        </div>
        <div className="image4">
            <img src="/images/Vlad.jpg"/>
        </div>
    </div>
  );
}

export default Cards
